import React from "react";
import { FaArrowDown, FaArrowUp } from "react-icons/fa";
import Task from "./Task";

const CompletedProjects = ({
  tasks,
  projects,
  onShowProjects,
  showProjects,
}) => {
  console.log(showProjects);
  return (
    <div>
      <h2
        onClick={onShowProjects}
        style={{ color: "white", backgroundColor: "black" }}
      >
        Completed Projects {showProjects ? <FaArrowUp /> : <FaArrowDown />}
      </h2>
      {projects.length > 0
        ? projects.map(
            (project) =>
              showProjects && (
                <div>
                  <h3 style={{ backgroundColor: "#f4f4f4" }}>{project.text}</h3>
                  {tasks.map(
                    (task) =>
                      task.type === "project.text" && <h4>{task.text}</h4>
                  )}
                </div>
              )
          )
        : showProjects && (
            <h3 className="main" style={{ backgroundColor: "#f4f4f4" }}>
              No Projects
            </h3>
          )}
    </div>
  );
};

export default CompletedProjects;
